BarChart.js.keyStrokeInfo:
svg
       .select(".plot-area")
       .attr("fill", "steelblue")
       .selectAll(".bar")
       .data(data)
       .join("rect")
       .attr("class", "bar")
       .attr("x", (d) => x(d.year))
       // .text("x", (d) => x(d.year))
       .attr("width", x.bandwidth())
       .attr("y", (d) => y1(d.sales))
       .attr("height", (d) => y1(0) - y1(d.sales));
       
     
   },
   [data.length]
 );
